import React from 'react';

class EmployeeLeft extends React.Component {
    render() {
        let { employees, pageInfo, onClickEmployee } = this.props;
        let employeeList = null;


        let pageLink = [];
        let pageSize = 5;
        let pageNo = 1;
        let totalPageNo = 1;
        if(Object.keys(queryParams).length !== 0) {
            pageNo = queryParams["pageNo"]
            pageSize = queryParams["pageSize"]
        }
        console.log(JSON.stringify(pageInfo));
        if(Object.keys(pageInfo).length !== 0) {
            console.log(pageInfo.count);
            pageNo = queryParams["pageNo"]
            pageSize = queryParams["pageSize"]
            totalPageNo = Math.ceil(pageInfo.count / pageSize);
        }
        if (employees.length !== 0) {
            console.log(employees.length);
            console.log("count:" + pageInfo.count);
            employeeList = employees.map((employee) => (
                <p key={employee.EmployeeID}>
                    <a href='' onClick={() => onClickEmployee(employee.EmployeeID)}>
                        {employee.EmployeeNumber} {employee.FirstName} {employee.LastName}</a>
                </p>
            ));
            for (let i = 0; i < totalPageNo; i++) {
                pageLink.push(
                    <a href={'./employees?pageSize='+pageSize+'&pageNo='+(i+1)}> {i + 1} </a>
                );
            }
            console.log("totalPageNo:" + totalPageNo);
            console.log("pageLink:" + pageLink);
        }
        return (
            <div>
                {employeeList}
                <div id='pg'>{pageLink}</div>
                
            </div>
        );
    }
}

export { EmployeeLeft }
